                            </div> */}
                        </div>
                    </div>
                </div>


        


                <div>
                    <div className="container shadow col-md-5 d-flex flex-column align-items-center text-white justify-content-center my-0" d-flex>                    
                            <h1 className="display-10 fw-bolder">Welcome Back</h1>
                            <p className="lead text-center">Enter Your Credentials To Login</p>
                    </div>
                </div>
            
            
            
            
            
            </section>
        </div>
    );
}

export default Home;








